ifyProductImages(item.productName, item.img);\n});\n//4.3. Get Product Name, Quanity, Price, Total and log each row\nthis.productData.forEach(item =&gt; {\n  cartPage.getProductName(item.index).then(name =&gt; {\n    cartPage.getQty(item.index).then(qty =&gt; {\n      cartPage.getPrice(item.productName).then(price =&gt; {\n        cartPage.getTotal(item.productName).then(total =&gt; {\n          cy.log(`Row ${item.index}: ${name} - ${qty} - ${price} - ${total}`);\n        });\n      });\n    });\n  });\n});\n//4.4. Assert number of rows are equal number of items in fixture\nconst expectedLength = this.productData.length;\ncartPage.verifyNumberOfRows(expectedLength);\n//4.5. Assert total = price * quantity\nthis.productData.forEach(item =&gt; {\n  const expectedTotal = Number(item.quantity) * Number(item.price);\n  cartPage.getTotal(item.productName).then(total =&gt; {\n    const actualTotal = Number(total);\n    expect(actualTotal).to.equal(expectedTotal);\n  });\n});\n//4.6. Click Place Order and assert redirection\ncy.contains(&#x27;Place Order&#x27;).click();\ncountryPage.verifyUrl(&#x27;/country&#x27;);\n//Task 5: Checkout\n//5.1. Verify the error message\ncy.get(&#x27;select&#x27;).select(&#x27;Vietnam&#x27;);\ncy.contains(&#x27;Proceed&#x27;).click();\ncountryPage.verifyErrorMsg(&#x27;Please accept Terms &amp; Conditions - Required&#x27;);\n//5.2.\ncy.get(&#x27;.chkAgree&#x27;).click();\ncy.contains(&#x27;Proceed&#x27;).click();\ncountryPage.verifySuccessMsg(&#x27;Thank you, your order has been placed successfully&#x27;);&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;9b6304d4-d080-4151-9a62-dd14ba831ae2&quot;,&quot;parentUUID&quot;:&quot;ffbca863-1c22-4e28-bc6a-2a19ba2331d2&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false}],&quot;suites&quot;:[],&quot;passes&quot;:[&quot;9b6304d4-d080-4151-9a62-dd14ba831ae2&quot;],&quot;failures&quot;:[],&quot;pending&quot;:[],&quot;skipped&quot;:[],&quot;duration&quot;:15525,&quot;root&quot;:false,&quot;rootEmpty&qu  promo code\ncy.get(&#x27;.promoInfo&#x27;, {\n  timeout: 10000\n}).should(&#x27;contains.text&#x27;, &#x27;Code applied ..!&#x27;);\n//Proceed order\ncy.contains(&#x27;Place Order&#x27;).click();\ncy.get(&#x27;select[style=\&quot;width: 200px;\&quot;]&#x27;).select(&#x27;Vietnam&#x27;);\ncy.get(&#x27;input[type=checkbox]&#x27;).click();\ncy.contains(&#x27;Proceed&#x27;).click();\n//Verify order successfully\ncy.contains(&#x27;Thank you, your order has been placed successfully&#x27;).should(&#x27;be.visible&#x27;);&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;9883bc68-8a84-4451-bfa6-0c63da5fd053&quot;,&quot;parentUUID&quot;:&quot;d2046a6d-31b3-4984-b36f-3238814c84aa&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false}],&quot;suites&quot;:[],&quot;passes&quot;:[&quot;9883bc68-8a84-4451-bfa6-0c63da5fd053&quot;],&quot;failures&quot;:[],&quot;pending&quot;:[],&quot;skipped&quot;:[],&quot;duration&quot;:10631,&quot;root&quot;:false,&quot;rootEmpty&quot;:false,&quot;_timeout&quot;:2000}],&quot;passes&quot;:[],&quot;failures&quot;:[],&quot;pending&quot;:[],&quot;skipped&quot;:[],&quot;duration&quot;:0,&quot;root&quot;:true,&quot;rootEmpty&quot;:true,&quot;_timeout&quot;:2000}],&quot;meta&quot;:{&quot;mocha&quot;:{&quot;version&quot;:&quot;7.2.0&quot;},&quot;mochawesome&quot;:{&quot;options&quot;:{&quot;quiet&quot;:false,&quot;reportFilename&quot;:&quot;mochawesome&quot;,&quot;saveHtml&quot;:false,&quot;saveJson&quot;:true,&quot;consoleReporter&quot;:&quot;spec&quot;,&quot;useInlineDiffs&quot;:false,&quot;code&quot;:true},&quot;version&quot;:&quot;7.1.4&quot;},&quot;marge&quot;:{&quot;options&quot;:{&quot;charts&quot;:true,&quot;reportPageTitle&quot;:&quot;Cypress Incline Reporter&quot;,&quot;embeddedScreenshots&quot;:true,&quot;inlineAssets&quot;:true,&quot;overwrite&quot;:false,&quot;html&quot;:false,&quot;json&quot;:true,&quot;reportDir&quot;:&quot;cypress\\reports\\html\\.jsons&quot;},&quot;version&quot;:&quot;6.3.2&quot;}}}" data-config="{&quot;reportFilename&q
